    }

    #glCanvas {
        border: 1px solid darkgrey;
        image-rendering: pixelated;
        touch-action: none;
        width: 600px;
        height: 600px;
    }

    .full-width-slider {
        width: 100%;
    }

    .gbp-button {
        /* width: fit-content;
        height: fit-content; */
        float: left;
        outline: none;
        border: black;
    }

    .disabled {
        opacity: 0.5;
    }

    #wrapper {
        /* border: none; */
        /* background-color: white; */
        display: grid;
        grid-column: page;  /* start and end the grid on the page */
        max-width: calc(100vw - 2em);
        font-size: 14px;
        user-select: none;
        grid-template-columns: auto;
        grid-template-rows: auto auto;  /* two rows */
        grid-auto-flow: row;
        row-gap: 10px;
        width: 600px;
    }

    #control-panel {
        width: 600px;
        line-height: 1em;
        display: grid;
        grid-template-columns: auto;
        grid-template-rows: 30px 80px 105px 23px 60px 20px 140px;
        grid-row-end: auto;
        row-gap: 10px;
    }

    #caption {
        text-align: left;
        grid-column: page;
        width: 650px;
    }

    @media (min-width: 1180px) {
        #wrapper {
            grid-template-columns: auto 400px;
            grid-template-rows: auto;  
            grid-auto-flow: column;
            grid-column-gap: 25px;
            width: 1025px;
            /* background-color: lightyellow; */
