    .status {
        font-size: 12px;
        color: rgba(0, 0, 0, 0.6);
        font-family: monospace;
    }

    .slider-container {
        font-size: 14px;
    }

    #play-pause-reset {
        width: fit-content;
        height: fit-content;
    }

    #precision-sliders {
        display: grid; 
        grid-template-columns: 1fr 1fr;
        grid-gap: 20px;
