        margin-top: 8px;
    }

    .hint {
        color: rgba(0, 0, 0, 0.6);
        user-select: text;
        font-size: 16px;
        line-height: 1.4em;
    }
    
    .bold-text {
        font-weight: bold;
    }

    #button-groups-panel {
        display: grid; 
        grid-template-columns: 1fr 1fr;
        grid-gap: 20px;
    }

    #radius-slider {
        width: 80%;
    }

    #radius-text {
        font-size: 11px; 
        margin-left: 5px;
    }
    
    #vid {
        display: none;
    }

    #img-choice {
        display: grid;
        grid-template-columns: 1fr 1.5fr;
    }

